import axios from "axios";
import React, { useEffect, useState, useCallback } from "react";
import { Link, useNavigate, useParams } from "react-router-dom";

export default function EditarPersonal() {
  const urlBase = "http://localhost:8080/sipress-app/personalS";

  let navigate = useNavigate();
  const { id } = useParams();

  const [personal, setPersonal] = useState({
    idPersonal: "",
    nombrePersonal: "",
    apellidoPersonal: "",
    telefonoPersonal: "",
    emailPersonal: "",
    idDependencia: "", // Este campo almacenarÃ¡ el ID de la dependencia
  });

  const [dependencias, setDependencias] = useState([]);

  useEffect(() => {
    // Cargar las dependencias al montar el componente
    const cargarDependencias = async () => {
      const resultado = await axios.get(
        "http://localhost:8080/sipress-app/dependencias"
      );
      setDependencias(resultado.data);
    };

    cargarDependencias();
  }, []);

  const cargarPersonal = useCallback(async () => {
    const resultado = await axios.get(`${urlBase}/${id}`);
    setPersonal(resultado.data);
  }, [id]);

  useEffect(() => {
    cargarPersonal();
  }, [id, cargarPersonal]); // Proporciona 'id' y 'cargarPersonal' como dependencias

  const onInputChange = (e) => {
    setPersonal({ ...personal, [e.target.name]: e.target.value });
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    await axios.put(`${urlBase}/${id}`, personal);
    navigate("/personalS");
  };

  return (
    <div className="p-4" id="details">
      <div className="row justify-content-center">
        <div className="col-lg-9">
          <div className="card">
            <div className="card-header">
              <h4>Modificar Registro</h4>
            </div>
            <form onSubmit={(e) => onSubmit(e)}>
              <div className="card-body">
                <div className="form-floating form-group mb-3">
                  <input
                    type="text"
                    className="form-control"
                    id="idPersonal"
                    name="idPersonal"
                    placeholder="ID Personal"
                    required={true}
                    value={personal.idPersonal}
                    onChange={(e) => onInputChange(e)}
                  />
                  <label htmlFor="idPersonal">ID del Personal</label>
                </div>

                <div className="form-floating form-group mb-3">
                  <input
                    type="text"
                    className="form-control"
                    id="nombrePersonal"
                    name="nombrePersonal"
                    placeholder="Nombre del Personal"
                    required={true}
                    value={personal.nombrePersonal}
                    onChange={(e) => onInputChange(e)}
                  />
                  <label htmlFor="nombrePersonal">Nombre del Personal</label>
                </div>

                <div className="form-floating form-group mb-3">
                  <input
                    type="text"
                    className="form-control"
                    id="apellidoPersonal"
                    name="apellidoPersonal"
                    placeholder="Apellido del Personal"
                    required={true}
                    value={personal.apellidoPersonal}
                    onChange={(e) => onInputChange(e)}
                  />
                  <label htmlFor="apellidoPersonal">
                    Apellido del Personal
                  </label>
                </div>

                <div className="form-floating form-group mb-3">
                  <input
                    type="tel"
                    className="form-control"
                    id="telefonoPersonal"
                    name="telefonoPersonal"
                    placeholder="TelÃ©fono del Personal"
                    required={true}
                    value={personal.telefonoPersonal}
                    onChange={(e) => onInputChange(e)}
                  />
                  <label htmlFor="telefonoPersonal">
                    TelÃ©fono del Personal
                  </label>
                </div>

                <div className="form-floating form-group mb-3">
                  <input
                    type="email"
                    className="form-control"
                    id="emailPersonal"
                    name="emailPersonal"
                    placeholder="Email"
                    required={true}
                    value={personal.emailPersonal}
                    onChange={(e) => onInputChange(e)}
                  />
                  <label htmlFor="emailPersonal">Email</label>
                </div>

                <div className="form-floating form-group mb-3">
                  <select
                    className="form-control"
                    id="idDependencia"
                    name="idDependencia"
                    required={true}
                    value={personal.idDependencia}
                    onChange={(e) => onInputChange(e)}>
                    {dependencias.map((dependencia) => (
                      <option
                        key={dependencia.idDependencia}
                        value={dependencia.idDependencia}>
                        {dependencia.nombreDependencia}
                      </option>
                    ))}
                  </select>
                  <label htmlFor="idDependencia">Dependencia</label>
                </div>

                <button type="submit" className="btn btn-primary">
                  <i className="fa-regular fa-floppy-disk"></i> Guardar Cambios
                </button>
                <Link to="/personalS">
                  <i className="fa-solid fa-triangle-exclamation"></i> Cancelar
                </Link>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}
